import React from "react"
import './Calendar.css'

function Calendar(){
    let data = new Date();
    let month = data.getMonth + 1
    return (
        <div><p>Текущая дата: {data.getDate()}.{month}.{data.getFullYear()}</p></div>
    )
}
export default Calendar;
